import React from 'react';

const Navbar = () => {
  const scrollToSection = (id) => {
    const section = document.getElementById(id);
    if (section) {
      section.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light fixed-top">
      <div className="container">
        <a className="navbar-brand" href="#home">Portfolio</a>
        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav ml-auto">
            <li className="nav-item">
              <a className="nav-link hover-effect" onClick={() => scrollToSection('about')} href="#about">About</a>
            </li>
            <li className="nav-item">
              <a className="nav-link hover-effect" onClick={() => scrollToSection('skills')} href="#skills">Skills</a>
            </li>
            <li className="nav-item">
              <a className="nav-link hover-effect" onClick={() => scrollToSection('projects')} href="#projects">Projects</a>
            </li>
            <li className="nav-item">
              <a className="nav-link hover-effect" onClick={() => scrollToSection('contact')} href="#contact">Contact</a>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
